def draw(matrix, size, colors, dico, marginX=0, marginY=0): # ensemble des parametres
    for x in range(len(matrix[0])): # on recupere la largeur de la matrice
        for y in range(len(matrix)): # on recupere la hauteur de la matrice
            if matrix[y][x] in colors: # si la couleur en y;x et défnit dans colors
                if len(colors[matrix[y][x]]) == 2: # si on a une longueur de 2 c'est qu'il y a un dictionnaire utilisé
                    if dico[str(colors[matrix[y][x]][1])] == "False": # si la valeur est définit en inactif
                        if matrix == body: # si la matrice est le corps
                            pygame.draw.rect(screen, (255,255,255), (size*(x+marginX), size*(y+marginY), size, size)) # la couleur inactif du corps est blanc
                        else:
                            pygame.draw.rect(screen, (229,57,53), (size*(x+marginX), size*(y+marginY), size, size)) # la couleur inactif du menu est rouge
                    else:
                        pygame.draw.rect(screen, colors[matrix[y][x]][0], (size*(x+marginX), size*(y+marginY), size, size)) # la couleur actif est rouge
                else:
                    pygame.draw.rect(screen, colors[matrix[y][x]], (size*(x+marginX), size*(y+marginY), size, size)) # la couleur actif du menu est vert

    if innit == False and Materiel_menu_display == True or innit == False and seance_option_display == True: draw_settings_icon(settings_icon, size) # si nue des condition est vraie on affiche le bouton des parametres
    pygame.display.update() # on rafraichit l'écran


def get_exo():
    listexo = []
    muscle_names = set(bool_dico_msucle.keys())
    with open("Projet NSI.txt", "r") as f:
        data = f.read()
    for exo in data.split('\n'):
        exo_data = exo.split(';')
        if exo_data[1]:  # Check if the exercise name is not empty
            if any(str(muscle) in str(exo_data[2]) and bool_dico_msucle[muscle] == "True" for muscle in muscle_names):
                if "Pas de matériel" in exo_data[5] and aucun or "Matérielle achetable" in exo_data[5] and MaterielleAchetable or "A faire en salle" in exo_data[5] and EnSalle:
                    listexo.append((exo_data[1], exo_data[2], exo_data[3]))
    return listexo

""" PERMET D'ECRIRE DU TEXTE AVEC LA POLICE DE L'INTERFACE """
def ecrire(text, margX, margY):
    text = text.replace('les ','').replace('à','a').replace('é','e')
    current_x = margX-len(alphabet[text[0]][0])
    for x in range(len(text)):
        if str(text[x]) == ' ':
            pass
        else:
            if text[x-1] == ' ':
                current_x += (len(alphabet[text[x-2]][0])+1)+3
            else:
                current_x += (len(alphabet[text[x-1]][0])+1)
            if text[x] in ['a','c','j','g','o','q','s']:
                draw(alphabet[text[x]], size, alphabet_colors2, None, current_x, margY)
            else:
                draw(alphabet[text[x]], size, alphabet_colors1, None, current_x, margY)
    pygame.display.update()


