def Training():
    listexo = get_exo() # Récupérer la liste des exercices
    nbexo = int(input("Combien d'exercices voulez-vous effectuer ? ")) # Demander à l'utilisateur combien d'exercices il souhaite effectuer
    seance = [] # Liste pour stocker la séance d'entraînement générée
    variete = [] # Liste pour stocker la variété des muscles présents dans la liste d'exercices

    for i in range(len(listexo)):  # Parcourir la liste d'exercices pour obtenir la variété des muscles
        if listexo[i][1] not in variete:
            variete.append(listexo[i][1])
    if nbexo > len(variete):  # Vérifier s'il y a suffisamment de variété de muscles disponibles
        print("Pas assez de variété de muscles disponibles. Augmentez le nombre de muscles à travailler ou réduisez le nombre d'exercices.")
    else:
        while len(seance) < nbexo:  # La séance d'entraînement est générée
            print(len(seance), nbexo)
            r = randint(0, len(listexo) - 1)
            exercise = listexo[r]
            print(exercise)
            muscle = exercise[1]
            if variete.count(muscle) > 0: # Vérifie si le muscle de l'exercice est encore disponible dans variété
                seance.append(exercise) # Ajoute l'exercice à la séance
                variete.remove(muscle) # Retire le muscle de la liste des muscles disponibles pour éviter la répétition du même muscle
    return seance

