def SeanceForce(seance):
    Bilan = []
    pb = 0
    for i in range(len(seance)):
        temp = list()
        serie = int(input(f"Combien de séries pour l'exercice {seance[i][0]} ? "))
        print("Prêt ? 3 2 1 GO!")
        temp.extend([seance[i][0], serie])
        for j in range(serie):
            poids = int(input(f"Quel poids avez vous réaliser pour la série {j+1} ?"))
            if poids>pb:
                pb = poids
            rep = int(input(f"Combien de répétition avez vous réaliser pour la série {j+1} ?"))
            temp.append(("Poids de la serie {}: {} kg et {} répétition".format(j+1,poids,rep)))
            temp.append(("Le PB est de {} kg".format(pb)))
    Bilan.append(temp)
    return Bilan



